import React from "react";



const Article = () => {

    return (

        <div className={styles.Article}>
            Курс валют на 18 декабря 2019
            <div className={styles.Currency}>USD </div>
            <div className={styles.Currency}>USD </div>
            <div className={styles.Currency}>USD </div>
        </div>
    )
}

export default Article
